import React, { componentDidMount,Component } from 'react'
import { connect } from 'react-redux'
import axios from 'axios'
import * as ReactBoostrap from 'react-bootstrap';

export default class BorrarAgendaServicio extends Component
{
  constructor()
  {
    super();
    this.state = {
      agenda: [],
      agendaBorrado: {},
      agendaBorradoId: 0,
    }
  }
  componentDidMount = () => {
    axios.get('http://localhost:9090/').then((resp) => {
        this.setState({
            servicios: resp.data,              
        });
    }).catch((error) => {
        console.log(error);
    }
    )
  };
 
  
  render()
  {

    return (
      <div>
       
          <h1>Borrar Servicios</h1>
         

            <ReactBoostrap.Table  hover variant="light-dark">
            <table className="table ">
            <thead>
              <th scope="col">ID</th ><th scope="col">Nombre</th>
                <th scope="col"></th>
              </thead>
              <tbody>
              {
                this.state.servicios.map(elemento => (
                  <tr key={elemento.id} value={elemento} id={elemento.id}>
                    <td>{elemento.id}</td>
                    <td>{elemento.nombre}</td>
                    <td><ReactBoostrap.Button type="button" className="btn btn-secondary" value={elemento.id} id={elemento.id}
                      name={elemento.id} onClick={this.elegirServicioBorrado}>borrar</ReactBoostrap.Button></td>
                  </tr>
                ))
                }
                  </tbody>
              </table>
          </ReactBoostrap.Table>
          
        
      </div>
    )
  }
}
